INSERT INTO `settings` (`id`, `name`, `value`, `created_at`, `updated_at`) VALUES
(0, 'privacy_policy', '--', NULL, NULL),
(1, 'domain', 'info@nogal-furniture.com', NULL, '2019-10-31 08:44:30'),
(2, 'title', 'Nogal', NULL, NULL),
(3, 'theme', 'skin-green-light', NULL, '2021-03-04 20:51:05'),
(4, 'phone', 'Tel.: 3851 9333 - 3851 9444  /  Mob.: 0122 2222 712', NULL, '2020-05-03 18:04:04'),
(5, 'about_ar', 'تأسست NOGAL FURNITURE في ديسمبر 1995 ، وهي شركة مملوكة عائليًا أصبحت من بين متاجر الأثاث الرائدة في مصر\r\nتشتهر الشركة بانجرافها المميز نحو المجموعات المعاصرة والكلاسيكية ، وتلبية أنماط المنزل العصري والمكاتب والمستشفيات والفنادق والمدارس\r\nنحو المجموعات المعاصرة والكلاسيكية ، وتلبية أنماط المنزل الحديث والمكاتب والمستشفيات والفنادق والمدارس. حول شركة نوجال للأثاث بدأت الشركة أعمالها من خلال استيراد منتجات راقية من إسبانيا وإيطاليا والولايات المتحدة الأمريكية والصين ، مثل غرف النوم وغرف الطعام والطاولات وأثاث المكاتب والإضاءة وغرف المعيشة ، والتي تم عرضها في صالة العرض الرئيسية بمساحة 1100 متر مربع في منطقة الشيخ زايد. ومنذ ذلك الحين حققنا نموًا كبيرًا على مر السنين من حيث مبيعات وتوزيع الأثاث الكلاسيكي والحديث في مصر.', NULL, '2020-02-11 12:45:20'),
(6, 'about_en', 'Established in December 1995, NOGAL FURNITURE is a family owned company that became among the leading furniture stores in Egypt. \r\n\r\nThe company  is known for its distinctive drift toward contemporary and classic collections,  meeting the styles of the modern day home, offices, hospitals, hotels and schools.\r\n\r\n About Nogal Furniture The company started its business by importing high end products from Spain, Italy, USA and China, such as bed rooms,dining rooms,tables, office furniture, lighting and  living rooms, which was displayed in our 1100 m2 main showroom in ElShiekhZayed area.\r\n\r\n Since then we have achieved substantial growths over the years in terms of  sales and distribution of classic and modern furniture in Egypt.\r\n\r\nAt Nogal Furniture, we believe in inspiring sense of a lifestyle not just decorating homes. By gathering art craft and fine woods, we produce high standard luxurious steel furniture with very distinguished designs in addition to classy home accessories which look fascinating and yet, so comfortable.\r\n\r\n What We Do For You\r\nOur mission at Nogal Furniture is to the point: to provide you with great quality of furniture. ', NULL, '2020-02-11 12:45:19'),
(7, 'language', 'En', NULL, '2021-03-01 15:35:28'),
