(185, 'about_description', 'Established in December 1995, NOGAL FURNITURE is a family owned company that became among the leading furniture stores in Egypt. The company  is known for its distinctive drift toward contemporary and classic collections,  meeting the styles of the modern day home, offices, hospitals, hotels and schools.  The company started its business by importing high end products from Spain, Italy, USA and China, such as bed rooms, dining rooms, tables, office furniture, lighting and  living rooms, which was displayed in our 1100 m2 main showroom in ElShiekh Zayed  area.  Since then we have achieved substantial growths over the years in terms of  sales and distribution of classic and modern furniture in Egypt.', 'تأسست شركة NOGAL FURNITURE في ديسمبر عام 1995 ، وهي شركة مملوكة للعائلة وأصبحت من بين متاجر الأثاث الرائدة في مصر. تشتهر الشركة بانجرافها المتميز نحو المجموعات المعاصرة والكلاسيكية ، وتلبية أنماط المنزل الحديث والمكاتب والمستشفيات والفنادق والمدارس.  بدأت الشركة أعمالها من خلال استيراد المنتجات الراقية من إسبانيا وإيطاليا والولايات المتحدة الأمريكية والصين ، مثل غرف النوم وغرف الطعام والطاولات والأثاث المكتبي والإضاءة وغرف المعيشة ، والتي تم عرضها في صالة العرض الرئيسية التي تبلغ مساحتها 1100 متر مربع في منطقة الشيخ زايد. .  منذ ذلك الحين حققنا نموًا كبيرًا على مر السنين من حيث المبيعات وتوزيع الأثاث الكلاسيكي والحديث في مصر.', '2020-02-17 06:39:58', '2020-02-17 07:41:39'),
